import React, {useState, useEffect} from 'react';
import './BottomComponent.scss';
import Roles from "../RoleComponent/Roles";
import StatusBoard from "../StatusBoard/StatusBoard";


function BottomComponent(props) {
    const [data, setData] = useState([])

    useEffect(() => {
        fetch('http://localhost:3002/api')
            .then((response) => response.json())
            .then((response) => setData(response))
    }, [])
    const DataOfStatusBoard = [
        {
            img_link: "img/apple.png",
            company: "Apple",
            position: "Visual Designer",
            duration: "Full time",
            job_id: "123456789",
            status: "Phone Interview"
        },
        {
            img_link: "/img/booster.png",
            company: "booster",
            position: "Product Designer",
            duration: "Full time",
            job_id: "123456788",
            status: "Applied"
        },
        {
            img_link: "/img/google.png",
            company: "Google",
            position: "Interactive Designer",
            duration: "Full time",
            job_id: "123456787",
            status: "Zoom Call"
        },
        {
            img_link: "/img/instagram.png",
            company: "Instagram",
            position: "Product Designer",
            duration: "12-months",
            job_id: "123456786",
            status: "Round 2 Interview"
        },
        {
            img_link: "/img/omadahealth.png",
            company: "Omada Health",
            position: "UX/ UI Designer",
            duration: "Full time",
            job_id: "123456785",
            status: "Phone Interview"
        },
        {
            img_link: "/img/salesforce.png",
            company: "Salesforce",
            position: "Visual Designer",
            duration: "12-months",
            job_id: "123456784",
            status: "Zoom Call"
        },

    ];

    const title = "Roles";
    const titles = data;
    const DataOfRoles = [
        {
            number: 6,
            title: 'Visual Designer'
        },
        {
            number: 4,
            title: 'Product Designer'
        },
        {
            number: 6,
            title: 'Interactive Designer'
        },
        {
            number: 2,
            title: 'UX/ UI Designer'
        },
    ];
    const titleOfStatusBoard = "Status Board";
    const DataOFTools = [
        "filter-option.png",
        "pencil-edit.png",
        "share-option.png",
        "search-option.png",
        "delete-option.png",
    ]
    return (
    <div className="main-block">
        <div className="status-board">
            <StatusBoard  data = {DataOfStatusBoard} dataOfTools = {DataOFTools} title = {titleOfStatusBoard} titles = {titles}/>
        </div>
       <div className="roles">
           <Roles title = {title} data = {DataOfRoles}/>
       </div>

    </div>
    );
}
export default BottomComponent;
